import React, { Component } from "react";
import Nav from "./Nav";
import axios from "axios";

class Doctors extends Component {
    constructor() {
        super();
        this.state = {
            doctorlist: []
        }
    }





    async componentDidMount() {
        this.setState({ loading: true });
        const response = await axios.get('http://localhost:8080/hospitalApp/doctor/all') // GET meth
        console.log(response.data);
        this.setState({
            loading: false,
            doctorlist: response.data
        })
        console.log(this.state.doctorlist)
    }


    render() {

        const { doctorlist } = this.state;
        return (
            <div>
                <Nav />
                <div className="">
                    <table className="table table-striped">

                        <thead>
                            <tr>
                                <td scope="col"><b>view</b></td>
                                <td scope="col"><b>First</b></td>
                                <td scope="col"><b>Last</b></td>
                                <td scope="col"><b>Specialization</b></td>

                                <td scope="col"><b>Available</b></td>

                                <td scope="col"><b>Mobile</b></td>

                            </tr>
                        </thead>

                        <tbody>

                            {doctorlist.map((doctor, key) => {
                                return (
                                    <tr>

                                        <td>n</td>
                                        <td>{doctor.fName}</td>
                                        <td>{doctor.lName}</td>
                                        <td>{doctor.specialization}</td>
                                        <td>{doctor.isAvailable.true}</td>
                                        <td>{doctor.mobileNum}</td>
                                    </tr>

                                )
                            })}




                        </tbody>
                    </table>
                </div>
            </div >
        );
    }
}


export default Doctors;
